function getArrayObjects(count = 10) {
    return users.slice(0, count <= users.length ? count : users.length);
}

function getRandomObject() {
    const index = Math.round(Math.random() * 100);
    return users[index > 99 ? 99 : index];
}

module.exports = { getArrayObjects, getRandomObject };
